import axios from 'axios'
import ReactTable from 'react-table';
//import "react-table/react-table.css"
class Tablee extends Component{
    constructor(){
                super();
                this.state = {
                    tableInformation:[] } }
            componentDidMount() {
                axios.get('https://restcountries.com/v3.1/all')
                .then(response => {
                      this.setState({tableInformation: response.data})
                })  
                .catch(error => {
                     alert('soumthing rong!');
                })
            }
    render(){
        const tableData = this.state.tableInformation
        const col = [{Header: "Contry Name", accessor: "name"}, {Header: "Capital", accessor: "Capital"}];
        return (
            <div>
                <p>table</p>
                   <ReactTable
                   data = {tableData}
                   columns = {col}
                   defaultPageSize = {10}
                   pageSizeOption = {[10,20,30,40,50]}

                   /></div> ); }}
export default Tablee;
